import { GET_ITEMS, Post_Plan } from "../Actions/Types";

const initialState = {
  items: [],
  auth: false,
  PlanType: "",
};

export default function (state = initialState, action) {
  console.log(action)
  switch (action.type) {
    case GET_ITEMS:
      return {
        ...state,
        items: action.payload,
      };
    case Post_Plan:
      return {
        ...state,
        PlanType: action.payload,
      };
    default:
      return state;
  }
}
